import React, { useEffect, useState } from "react";
import { connection, startConnection } from "../services/signalRService";
import api from "../services/api";
import { Link } from "react-router-dom";
import { getPriorityClass, getStatusClass } from "../utils";
import axios from "axios";

interface Ticket {
  id: number;
  title: string;
  description: string;
  priority: string;
  status: string;
}

const AdminDashboard: React.FC = () => {
  const [tickets, setTickets] = useState<Ticket[]>([]);

  useEffect(() => {
    const fetchTickets = async () => {
      const response = await api.get("/tickets");
      setTickets(response.data);
    };

    const setupSignalR = async () => {
      await startConnection(); // Ensure connection starts only once

      // Prevent duplicate handlers
      connection.off("NewTicket");
      connection.off("UpdateTicket");
      connection.off("DeleteTicket");

      connection.on("NewTicket", (ticket: Ticket) => {
        setTickets((prev) => [...prev, ticket]);
      });

      connection.on("UpdateTicket", (updatedTicket: Ticket) => {
        setTickets((prev) =>
          prev.map((ticket) =>
            ticket.id === updatedTicket.id ? updatedTicket : ticket
          )
        );
      });

      connection.on("DeleteTicket", (deletedTicketId: number) => {
        setTickets((prev) => prev.filter((ticket) => ticket.id !== deletedTicketId));
      });
    };

    fetchTickets();
    setupSignalR();

    // Cleanup handlers
    return () => {
      connection.off("NewTicket");
      connection.off("UpdateTicket");
      connection.off("DeleteTicket");
    };
  }, []);

  const updateTicketStatus = async (ticketId: number, newStatus: string) => {
    try {
      const payload = { status: newStatus };
      console.log(`Sending PUT request to /tickets/${ticketId} with payload:`, payload);
  
      const response = await api.put(`/tickets/${ticketId}`, payload);
      console.log("API Response:", response.data);
  
      setTickets((prev) =>
        prev.map((ticket) =>
          ticket.id === ticketId ? { ...ticket, status: newStatus } : ticket
        )
      );
    } catch (err) {
      if (axios.isAxiosError(err)) {
        console.error("Error updating ticket status:", err.response?.data || err.message);
      } else {
        console.error("Unexpected error:", err);
      }
    }
  };
  

  const deleteTicket = async (ticketId: number) => {
    try {
      console.log(`Deleting ticket ${ticketId}`);
      await api.delete(`/tickets/${ticketId}`);
      setTickets((prev) => prev.filter((ticket) => ticket.id !== ticketId));
      console.log("Ticket deleted successfully.");
    } catch (err) {
      if (axios.isAxiosError(err)) {
        console.error("Error deleting ticket:", err.response?.data || err.message);
      } else {
        console.error("Unexpected error:", err);
      }
    }
  };
  

  return (
    <div className="min-h-screen bg-gray-50 p-6">
      <h1 className="text-3xl font-bold mb-6">Admin Dashboard</h1>
      <div className="space-y-4">
        {tickets.map((ticket) => (
          <div key={ticket.id} className="p-4 bg-white shadow rounded-lg">
            <h2 className="text-lg font-semibold">{ticket.title}</h2>
            <p className="text-gray-600">{ticket.description}</p>
            <p className={`text-gray-500 ${getPriorityClass(ticket.priority)}`}>Priority: {ticket.priority}</p>
            <p className={`text-gray-500 ${getStatusClass(ticket.status)}`}>Status: {ticket.status}</p>
            <div className="mt-4 flex space-x-2">
              <button
                onClick={() => updateTicketStatus(ticket.id, "In Progress")}
                disabled={ticket.status === "Closed"}
                className={`bg-yellow-500 text-white px-4 py-2 rounded-lg hover:bg-yellow-600 ${
                  ticket.status === "Closed" ? "opacity-50 cursor-not-allowed" : ""
                }`}
              >
                Mark In Progress
              </button>
              <button
                onClick={() => updateTicketStatus(ticket.id, "Closed")}
                disabled={ticket.status === "Closed"}
                className={`bg-red-500 text-white px-4 py-2 rounded-lg hover:bg-red-600 ${
                  ticket.status === "Closed" ? "opacity-50 cursor-not-allowed" : ""
                }`}
              >
                Close Ticket
              </button>
              <button
                onClick={() => deleteTicket(ticket.id)}
                className="bg-red-700 text-white px-4 py-2 rounded-lg hover:bg-red-800"
              >
                Delete Ticket
              </button>
              <Link
                to={`/tickets/${ticket.id}`}
                className="bg-blue-500 text-white px-4 py-2 rounded-lg hover:bg-blue-600"
              >
                View Ticket
              </Link>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AdminDashboard;
